/**
this class contains all the categorized emojis
*/

import Foundation
import KeyboardKit

class Emojis {

    
    
    struct EmojiTypes {
        
        var category:String
        var actions: [KeyboardAction]
        var type: EmojiCategory
    }

    
    func getEmoji() -> [EmojiTypes] {
        
        var emoji: [EmojiTypes] = []
        emoji.append(EmojiTypes(category: "SMILEYS & PEOPLE", actions: smileys,type: .smileys))
        emoji.append(EmojiTypes(category: "ANIMALS & NATURE", actions: animals,type: .animals))
        emoji.append(EmojiTypes(category: "FOODS & DRINKS", actions: foods,type: .foods))
        emoji.append(EmojiTypes(category: "ACTIVITY", actions: activities,type: .activities))
        emoji.append(EmojiTypes(category: "TRAVEL & PLACES", actions: travels,type: .travels))
        emoji.append(EmojiTypes(category: "OBJECTS", actions: objects,type: .objects))
        emoji.append(EmojiTypes(category: "SYMBOLS", actions: symbols,type: .symbols))
        emoji.append(EmojiTypes(category: "FLAGS", actions: flags,type: .flags))
        
        return emoji
    }
    
